settings.tooltipFunction:
var entityType = dsData[dsIndex]['entityType'];
var deviceType = dsData[dsIndex]['type'];
var entityName = dsData[dsIndex]['entityName'];
var rtspUrl = dsData[dsIndex]['rtspUrl'];


if (typeof deviceType !== undefined) {
        if (deviceType === 'camera'){
            return `<b>${entityName}</b> <br/> <b>Camera Name : </b> ${dsData[dsIndex]['Label']} <br/> <b>Active : </b> <span style="color: #4caf50; font-weight : 600;">Online</span> <br/> <br/> <a href=${rtspUrl}>Live Camera Feed </a>`;
        }else if (deviceType === 'slot'){
            return `<b>${entityName}</b><br/><br/><b>Slot status : </b> ${dsData[dsIndex]['occupancy']} <br />`;
        }
}

settings.polygonColorFunction:
var field = dsData[dsIndex]['occupancy'];
var deviceType = dsData[dsIndex]['deviceType'];


if(typeof deviceType !== undefined ){
    if(field === 'occupied'){
        return 'red';
    }else if(field === 'vacancy'){
        return 'green';
    }else if(field === 'reserved'){
        return 'blue';
    }else if(field === 'banned'){
        return 'yellow';
    }
}

